                <div class="infinity" id="stage"></div>
            </div>
            <div class="col-lg-8 col-md-8 col-xs-8">
                <div class="row">
                    <div class="quest-label"><p>Старт этапа</p></div>
                    <div class="startTime"><p id="startTime">00:00:00</p></div>
                </div>
                <div class="row">
                    <div class="time"><p id="timerSync">00:00</p></div>
                </div>
            </div>
        </div>
        <div class="row">
            <div id="game-message"></div>
            <div class="form-slider-rails">
                <div id="form-answer"><input id="form-input" placeholder="..."/>
                    <div id="btn-block" class="btn-block">
                        <div class="btn-recive col-lg-12 col-md-12 col-xs-12" id="send-auth">
                            <div><p>Авторизоваться</p></div>
                            <div><p><i class="arrow right"></i></p></div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        <div class="row">
            <div id="gamemenu" class="row">
                <div class="selector col-lg-4 col-md-4 col-xs-4 active-nav" id="task"><div class="ml-2"><p>Задание</p></div></div>
                <div class="selector col-lg-4 col-md-4 col-xs-4" id="paramstask"><div class="ml-2"><p>Парамеры</p></div></div>
                <div class="selector col-lg-4 col-md-4 col-xs-4" id="inventory"><div class="ml-2"><p>Инвентарь</p></div></div>
                <div id="line"></div>
            </div>
        </div>
        <div id="selectorView"></div>
    </div>
    <div class="modal_container">
        <div id="hd__modal_container"></div>
    </div>

    <div class="hidden-template">
        <div class="container" id="task-template">
            <div class="questtext"><p>{{stage_challenge_text}}</p></div>
        </div>
        <div class="container" id="btn-template">
            <div class="btn-recive col-lg-6 col-md-6 col-xs-6" id="send-message">
                <div><p>Чат</p></div>
                <div><p><i class="arrow right"></i></p></div>
            </div>
            <div class="btn-recive col-lg-6 col-md-6 col-xs-6" id="send-answer">
                <div><p>Ответ</p></div>
                <div><p><i class="arrow right"></i></p></div>
            </div>
        </div>
        <div class="container" id="btn_chng_nick-template">
            <div class="btn-recive col-lg-6 col-md-6 col-xs-6" id="send-nick">
                <div><p>Сменить ник</p></div>
                <div><p><i class="arrow right"></i></p></div>
            </div>
            <div class="btn-recive col-lg-6 col-md-6 col-xs-6" id="cancel">
                <div><p>Отменить</p></div>
                <div><p><i class="arrow right"></i></p></div>
            </div>
        </div>
        <div class="container" id="paramstask-template">
            <div class="col-qmod col-lg-4 col-md-8 col-xs-12">
                <div class="stage-info">
                    <div class="item">
                        <div>Сложность этапа</div>
                        <div class="info-value">{{difficult}}</div>
                    </div>
                    <div class="item">
                        <div>Тип задания</div>
                        <div class="info-value">{{type_challenger}}</div>
                    </div>
                    <div class="item">
                        <div>Тип ответа</div>
                        <div class="info-value">{{type_answer}}</div>
                    </div>
                    <div class="item">
                        <div>Времени на решение</div>
                        <div class="info-value">{{stageLimitTime}}</div>
                    </div>
                    <div class="item">
                        <div>Количество ответов</div>
                        <div class="info-value">{{count_answer}}</div>
                    </div>
                    <div class="item">
                        <div>Количество подсказок</div>
                        <div class="info-value">{{count_prompt}}</div>
                    </div>
                </div>
            </div>
        </div>
        <div class="container" id="inventory-template">
            <div id="inventory-grid" class="inventory">

            </div>
        </div>
        <div id="img_ItemInventory-template">
            <div class="item_container col-lg-4 col-md-4 col-xs-4">
                <div class="item_inventory js-click-modal" id="{{id}}">
                    <div class="item_ico"><img src="./images/ico/map_find_maps.png"></div>
                </div>

                <div class="modal_box js-close-modal" id="{{id}}__modal">
                    <div class="header">{{title}}</div>
                    <div class="modal-body">
                        <p>{{description}}</p>
                        <img src="{{src}}" class="edge">
                    </div>
                </div>
            </div>
        </div>
        <div id="text_ItemInventory-template">
            <div class="item_container col-lg-4 col-md-4 col-xs-4" data-toggle="modal" data-target="#{{id}}">
                <div class="item_inventory">
                    <div class="item_ico"><img src="./images/ico/map_find_maps.png"></div>
                </div>
                <div class="modal_box" id="{{id}}" tabindex="-1" aria-labelledby="{{id}}Label">
                    <div class="modal-content">
                        <div class="modal-header">
                            <h5 class="modal-title" id="{{id}}Label">{{title}}</h5>
                        </div>
                        <div class="modal-body">
                            <div><p>{{body}}</p></div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</div>
